import React from 'react';
import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';
import Carousel1 from "./BGmain1.jpg";


const CarouselComponent = () => {
  return (
    <div className="relative mt- m-20 rounded-3xl overflow-hidden h-64 cursor-grab">
      <Carousel showThumbs={false} showStatus={false} autoPlay={true}> 
        <div >
          <img src={Carousel1} alt="Slide 1" />
        </div>
        <div>
          <img src={Carousel1} alt="Slide 2" />
        </div>
        <div>
          <img src={Carousel1} alt="Slide 3" />
        </div>
      </Carousel>
    </div>
  );
};

export default CarouselComponent;
